void drawImage(int x, int y)
{
  int imageHeight = 64;
  int imageWidth = 64;
  int counter = 0;
  for (int yy = 0; yy < imageHeight; yy++)
  {
    for (int xx = 0; xx < imageWidth; xx++)
    {
      matrix.drawPixel(xx + x , yy + y, hottub[counter]);
      counter++;
    }
  }
}

